import React from 'react';
//import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <img src="/images/logo.png" alt="Company Logo" className="logo" />
      <h1 className="company-name">ROSTERS EMS</h1>
    </header>
  );
};

export default Header;
